// 페이지의 공통사항들은 여기서 처리한다.
// index.js 의 컴포넌트가 들어가는곳
import React from "react";
import "antd/dist/antd.css";
import { PropTypes } from "prop-types";

const App = ({ Component }) => {
  return <Component />;
};

App.prototype = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
